package main

/*
Below you'll find a set of coefficients for each sample rate.
If you need your own sample rate you can use this octave function to get them.
Fs is sampling rate, coeffs is the output vector,
changing N_factor to lower values will make the filter slower but more precise:

function coeffs = fir_pristella(Fs, Attn)
    Fcut1 = 10000
    Fcut2 = 18000
    N_factor = 4000

    f = [0, (2*Fcut1/Fs), (2*Fcut2/Fs), 1]
    a = [1, 1, Attn, Attn]
    coeffs = remez(Fs/N_factor, f, a)
    printf("%f, ",coeffs)
endfunction
*/

